import React from 'react';
import { styles } from 'ansi-colors';

const TextArea = () => {
  return <div style={styles.textArea}></div>;
  const styles = {
    textArea: {
      borderTopLeftRadius: '1rem',
      borderToptRightRadius: '1rem',
      width: '100%',
      paddingBottom: '50%',
      background: '#A2A2BD'
    }
  };
};

export default TextArea;
